"use strict";
// module Data.Eq
exports.refEq = function (r1) {
    return function (r2) {
        return r1 === r2;
    };
};
exports.refIneq = function (r1) {
    return function (r2) {
        return r1 !== r2;
    };
};
exports.eqArrayImpl = function (f) {
    return function (xs) {
        return function (ys) {
            if (xs.length !== ys.length)
                return false;
            for (var i = 0; i < xs.length; i++) {
                if (!f(xs[i])(ys[i]))
                    return false;
            }
            return true;
        };
    };
};
